import homeImage from "../img/photo.jpeg";

const Home = () => {
  const testFun = () => {
    console.log("Mouse dentro");
  };
  return (
    <div className="main-container">
      <div className="home-text">
        <h1 className="display-1">Pablo Asenjo</h1>
        <h3 className="display-3">Desarrollador Full-Stack</h3>
      </div>
      <div onMouseEnter={() => testFun()} className="testarea"></div>
    </div>
  );
};

export default Home;
